(2015, 108258, 'প্লিজ গণিত দাগানো ছাড়া গণিত রিলেটেড সাবজেক্ট দিবেন না।  \r\n\r\nএকটা কথা ভাবুন গণিত দাগিয়ে কি স্বাভাবিক ভাবে বাংলা বা ইংরেজি থেকে বেশি মার্ক উঠানো সম্ভব?  \r\nবাস্তবতা এটাই বাংলার একটা mcq দাগাতে যে পারে সে ১০-১২ সেকেন্ড নিবে যেখানে গণিতের অধিকাংশ প্রশ্ন সলভ করতে ৩০ সেকেন্ড এর বেশি সময় লাগে । কখনো কখনো ১ মিনিট ও লেগে যায়। \r\n\r\nতাই বাংলা ইংরেজি দাগানো কারো সাথে গণিত দাগানো কারোর মার্কের প্রতিযোগিতা সব সময়ই অসম।\r\n\r\nআর গণিত না দাগিয়ে গণিত রিলেটেড সাবজেক্ট পেলে পরবর্তিতে শিক্ষার্থীরা GST পরিক্ষায় গণিত দাগানোর উৎসাহ হারিয়ে ফেলবে।\r\n\r\nতাই NSTU এর মত নামকরা বিশ্ববিদ্যালয়, যে বিশ্ববিদ্যালয় কিনা webometrics এ GST ভুক্ত বিশ্ববিদ্যালয় গুলোর মধ্যে দ্বিতীয় অবস্থানে স্থান করছে, সে বিশ্ববিদ্যালয় গণিত সংক্রান্ত সাবজেক্ট গুলোর জন্য  গণিত দাগানোর শর্ত দিবে এটা আমরা আশা করি।\r\n\r\nআশা করি আমাদের এই আকঙ্খাটি NSTU এর ভর্তি কমিটির শিক্ষকগণের কাছে তুলে ধরা হবে।', NULL, NULL, 1, '2022-10-13 09:05:19', '2022-10-17 17:56:29'),
(2016, 121222, 'ভর্তি ফি ১০০ করলে উপকৃত হবো।', NULL, NULL, 1, '2022-10-13 11:24:38', '2022-10-17 17:56:38'),
(2017, 226360, 'NSTU এর মতো নামকরা বিশ্ববিদ্যালয়ের এমন সিদ্ধান্ত সত্যিই হতাশাজনক। গণিত উত্তর করেনি সে শিক্ষার্থী গণিতে স্বভাবতই দুর্বল।\r\nযেখানে ইঞ্জিনিয়ারিং এর মূল ভিত্তি হচ্ছে গণিত সেখানে বাংলা দাগানো একজন শিক্ষার্থীকে ইঞ্জিনিয়ারিং সাবজেক্ট দেওয়া সম্পূর্ণ অযৌক্তিক।\r\nবাংলা/ইংরেজি কখনোই গণিতের বিকল্প হতে পারে না। GST পরীক্ষায় গণিত প্রশ্ন দাগানোর জন্য যে সময় বরাদ্দ ছিল ঠিক সমপরিমাণ সময় বাংলা/ইংরেজির জন্যও ছিল। যেখানে একটি বাংলা/ইংরেজি প্রশ্ন দাগানোর জন্য ৩০ সেকেন্ড ব্যয় হয় সেখানে একটি গণিত প্রশ্নের উত্তর করতে কমপক্ষে এক মিনিট সময় ব্যয় হয়েছিল।\r\nযদি বাংলা/ইংরেজি দাগিয়ে ইঞ্জিনিয়ারিং সাবজেক্ট পাওয়া যায় তাহলে আগামীতে শিক্ষার্থীরা গণিত দাগানোর উৎসাহ হারিয়ে ফেলবে।\r\nতাই কর্তৃপক্ষের কাছে বিনীত অনুরোধ গণিত ব্যতীত ইঞ্জিনিয়ারিং সাবজেক্ট যেন না দেয়া হয়।\r\nআশা করি আমাদের এই বিষয়টি ভর্তি কমিটির কাছে তুলে ধরা হবে।\r\nধন্যবাদ', NULL, NULL, 1, '2022-10-13 12:53:14', '2022-10-17 17:56:44'),
