(2020, 118048, 'Math না দাগালে ইঞ্জিনিয়ারিং সাবজেক্ট দিবেন না।আর আমাকে ইঞ্জিনিয়ারিং CSE,EEE তে নিলে আপনাদের ভার্সিটির নাম উজ্জ্বল হবে।মার্ক হিসেবে নাও নিতে পারেন,কিন্তু আমার শেখা প্রোগ্রামিং কম্পিটেন্ট ক্যাপাবিলিটি অন্য কোন ভার্সিটি পেলে আমি ওই ভার্সিটিকে সম্মানিত করবো ইনশাআল্লাহ।তাই আমাকে সুযোগ দিলে,আমিও ভার্সিটিকে সম্মান এনে দিতাম।গুগলে আমি যাবোই।সেক্ষেত্রে আমি ফার্মেসিতে পড়ি, প্রাইভেটে CSE,EEE অথবা সিভিলে পড়ি কোনটাই আমাকে Google,Microsoft এ যাওয়া থেকে বিরত রাখতে পারবে না,মৃত্যু ছাড়া,ইনশাআল্লাহ।', NULL, NULL, 1, '2022-10-13 14:44:13', '2022-10-17 17:59:12'),
