(2027, 255286, 'বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় গুলোর মাঝে নোয়াখালি অত্যন্ত আধুনিক ও গৌরবময় বিশ্ববিদ্যালয়।আমরা আশাবাদী যে শ্রদ্ধেয় স্যারেরা গণিত উত্তর ব্যাতীত পিওর সাইন্স অনুষদ এবং ইঞ্জিনিয়ারিং অনুষদের কোনো সাবজেক্ট দিবেন না ইনশাআল্লাহ।', NULL, NULL, 1, '2022-10-13 22:14:21', '2022-10-17 17:59:44'),
(2028, 200768, 'স্যার NSTU  ভর্তি পরীক্ষায় জিপিএ এর এত মার্ক্স রাখা স্টুডেন্টদের জন্য আসলে ক্ষতিকর, এবং সঠিক মেধা যাচাই হবে না, এই বিষয় টা পুনরায় বিবেচনা করা উচিৎ। \r\nস্যার আপনারা নিশ্চই অবগত আছেন যে ২০২১ সালের উচ্চমাধ্যমিক পরিক্ষা শুধু তত্ত্বীয় বিষয়গুলোর উপর হয়েছে।বাকি সাব্জেক্ট গুলো ssc & jsc এর সাব্জেক্ট ম্যাপিং এ রেজাল্ট তৈরি হয়েছে, ফলে শিক্ষার্থীদের সঠিক দক্ষতা যাচাই হয়নি।\r\nএকটি উদাহরন লক্ষ করুন স্যার! ২০ সাল এ উচ্চমাধ্যমিক পরীক্ষার ফলাফল অটোপাস ঘোষনা করায়,ফলাফলে তীব্র বৈষম্য হয়েছে। যেখানে ২০২০ সালের পুর্বে উচ্চমাধ্যমিক এর ফলাফলে দেখাযেত সব মিলিয়ে জিপিএ ৫ বা A+ এর সংখ্যা ৪৫০০০<।  অটোরেজাল্ট দেওয়ায় এর সংখ্যা অটো বেড়ে ১লাখ ১৬ হাজারে রুপ নিয়েছে, স্যার উচ্চমাধ্যমিক এর লেখাপড়া মাধ্যমিক এর চেয়ে কিছুটা জটিল।যারা পড়াশুনা করেনি বা তুলনামূলক কম করেছে তারাও অটোরেজাল্টের কারনে জিপিএ ৫ পাইছে। এক্ষেত্রে জিপিএ এর মুল্যায়ন টা ভর্তি পরিক্ষার্থিদের সাথে বৈষম্য। স্যার ২১ সালে তত্বীয় বিষয়ে পরিক্ষা হলেও রেজাল্ট ঠিক ওইভাবে হয়েছে যেমন টা ২০ সালে হইছে।চট্টগ্রাম বোর্ডে ২০২১ সালে উচ্চমাধ্যমিক পরিক্ষায় দেখাগেছে উচ্চতর গনিত,জীববিজ্ঞান বিষয়ে অনেক শিক্ষার্থি ২০০ নম্বরের মধ্যে ২৪১(সর্বোচ্চ পেয়েছে)। এটা কিভাবে সম্ভব? \r\n\r\nভিসি স্যার সহ নোয়াখালী বিজ্ঞান প্রযুক্তি বিশ্ববিদ্যালয়ের সকল শিক্ষক স্যার দের কাছে আকুল আবেদন রইল ২০২১-২২ শিক্ষাবর্ষে NSTU তে শিক্ষার্থি ভর্তিক্ষেত্রে জিপিএ মার্ক্স না রাখা হয়..\r\n.. NSTU ভর্তিপরীক্ষার্থী', NULL, NULL, 1, '2022-10-14 02:23:56', '2022-10-17 17:59:57'),
