(2030, 105392, 'দেশের বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ের এর মধ্যে অন্যতম সনামধন্য বিশ্ববিদ্যালয় হয়েও বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ের মূল আকর্ষণ \'ইঞ্জিনিয়ারিং সাবজেক্ট\' ম্যাথ এ উত্তর না করে বাংলা বা ইংরেজী উত্তর করার পরেও দিয়ে দেওয়া হচ্ছে যা ইন্জিনিয়ারিং বিষয়ে মনোনীত হওয়ার নূন্যতম আদর্শের পরিপন্থী।\r\nএই ব্যাপারে কতৃপক্ষ কে পুনরায় বিবেচনা করার জন্য সবিনয় অনুরোধ জানাচ্ছি।', NULL, NULL, 1, '2022-10-14 04:45:32', '2022-10-23 12:41:34'),
(2031, 208658, 'নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় বাংলাদেশের সেরা বিশ্ববিদ্যালয় গুলোর মাঝে অন্যতম। আশা করি আমাদের বিজ্ঞ স্যার গনিত উত্তর ব্যতীত ইন্জিনিয়ারিং কোনো বিষয় দিবেন না। এটা আমাদের মতো শিক্ষার্থীদের পক্ষ থেকে একটি বিনীত অনুরোধ। আশা করি বিজ্ঞ স্যারেরা এটা গুরুত্বের সাথে বিবেচনা করবেন।', NULL, NULL, 1, '2022-10-14 05:10:00', '2022-10-17 18:00:23'),
(2032, 247199, 'গতবারের দাবি ছিলো ম্যাথ দাগিয়ে ইঞ্জিনিয়ারিং সাব্জেক্ট দেওয়ার।সার্কুলার দেওয়ার আগে বলা হয়েছিলো তারা এইবার যারা ম্যাথ দাগিয়েছে তাদেরকেই ইঞ্জিনিয়ারিং সাব্জেক্ট দিবে এবং বায়ো দাগানোর জন্য বায়োলজিক্যাল সাবজেক্ট দিবে।আজকেও সার্কুলারে GST এর দাগানো সাবজেক্ট এর ভিত্তিতে সাবজেক্ট দেওয়ার কোন শর্ত ই ছিলো না।যেহেতু কয়েক সপ্তাহ আগেই তারা এটি নিয়ে তাদের স্ট্যাটমেন্ট দিয়েছিলো এখন কথা না রাখার বিষয়টি কোন ভাবেই কাম্য নয়', NULL, NULL, 1, '2022-10-14 06:28:19', '2022-10-17 18:00:29'),
