(2037, 122938, 'আসসালামু আলাইকুম। যথাবিহীত সম্মানপূর্বক বিনীত নিবেদন এই যে,নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ের ওয়েবসাইটে প্রকাশিত ও পত্রিকায় প্রকাশিত এক বিজ্ঞাপন এর তথ্যানুযায়ী নোবিপ্রবির সকল ইউনিটে ভর্তির সাবজেক্ট ভিত্তিক যোগ্যতা ও আসনসংখ্যা প্রকাশিত হয়েছে।যেখানে গানিতিক ও ইন্জিনিয়ারিং অনুষদের বিষয়সমূহের জন্য কোনোরূপ বিশেষ শর্ত আরোপ করা হয়নি বরং এইচএসসি তে গনিত থাকলেই তারা আবেদনের যোগ্য বলা হয়েছে। এমতাবস্থায় ২০২১ সালের সংক্ষিপ্ত সিলেবাসে পরীক্ষা হওয়ায় চতুর্থ বিষয়ের পরীক্ষা হয়নি।সেক্ষেত্রে যারা গনিত বিষয়ে এইচএসসি তে পরীক্ষা দেয়নি তারা ও যোগ্যতা সম্পন্ন হচ্ছে। অথচ যারা গুচ্ছের পরীক্ষায় গনিত দাগিয়েছে তারা তুলনামূলক বৈষম্যের শিকার হচ্ছে কারন গনিতে মার্কস কম উঠার কারনে।এমন বিজ্ঞপ্তি নোবিপ্রবির মতো বড় বিশ্ববিদ্যালয় থেকে পাওয়া হতাশাজনক। গুচ্ছে যোগদানের পূর্বে ও নোবিপ্রবির গানিতিক ও ইন্জিনিয়ারিং অনুষদের জন্য গনিত দাগানো বাধ্যতা মুলক ছিলো।সে তুলনায় আমরা ২০২১ সালের গুচ্ছ পরীক্ষায় গনিত দাগানোর কারনে বৈষম্যের শিকার হচ্ছি,,অতএব স্যার দয়া করে ইন্জিনিয়ারিং অনুষদের জন্য বিশেষ শর্ত অথবা গনিত দাগানো বাধ্যতামুলক করার জন্য অনুরোধ রইলো।এটি সকল গনিত দাগানো শিক্ষার্থীদের যৌক্তিক দাবি।\r\nবিনীত \r\nএকজন সাধারণ শিক্ষার্থী', NULL, NULL, 1, '2022-10-14 11:28:04', '2022-10-17 18:00:59'),
