(2041, 225043, 'আসসালামু আলাইকুম। নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় বাংলাদেশের একটি সনামধন্য এবং আধুনিক বিশ্ববিদ্যালয়। আমি বিশ্বাস করি এই বিশ্ববিদ্যালয়ের শিক্ষকেরা সবসময় শিক্ষার্থীবান্ধব সিদ্ধান্ত নেন। আমরা শিক্ষার্থীরা চাই, গুচ্ছ ভর্তি পরীক্ষায় গণিতে যারা উত্তর করেছে শুধুমাত্র তাদেরকেই ইঞ্জিনিয়ারিং এবং গণিত বিষয়ক ডিপার্টমেন্টে ভর্তির সুযোগ দেওয়া হোক। এ বিষয়ে বিশ্ববিদ্যালয় থেকে আশ্বস্ত করা হলো হলেও সার্কুলারে শুধুমাত্র এইচএসসি পরীক্ষায় গণিত থাকতে হবে লেখা আছে।\r\nআমাদের ভবিষ্যতের কথা মাথায় রেখে আমাদের দাবী পূরণ করে বাধিত করবেন।', NULL, NULL, 1, '2022-10-14 17:25:32', '2022-10-17 18:01:16'),
(2042, 198041, 'আসসালামু আলাইকুম স্যার, \r\nদয়া করে ম্যাথ দাগানো ছাড়া ইঞ্জিনিয়ারিং সাবজেক্ট ও গানিতিক অনুষদের  সাবজেক্ট দিয়েন না।আমরা যারা গনিত উত্তর করেছি আমাদের সমস্যা হবে।একটু দয়া করেন স্যার।।', NULL, NULL, 1, '2022-10-14 18:04:11', '2022-10-17 18:01:26'),
(2043, 225753, 'গণিত উত্তর ব্যতীত ইঞ্জিনিয়ারিং ও গণিত বিভাগের বিষয় দেয়াটা কতটা যুক্তিসঙ্গত? যেখানে HSC তে পরীক্ষায় অনেক সংক্ষিপ্ত সিলেবাসে উত্তর করে শিক্ষার্থীরা। তারা অনেকে কোনরকমে HSC টপকেছে। আর ভর্তি পরীক্ষায় তো গণিত ছুঁয়েও দেখেনি। কিভাবে তারা পাচ্ছে ইঞ্জিনিয়ারিং? এমনই যদি হয় তবে ভর্তি পরীক্ষায় গণিত বিষয়টা তুলে দিয়েন আপনারা পরেরবার থেকে। বাংলা কিংবা ইংরেজী পরেই আমরা ইঞ্জিনিয়ার হবো l', NULL, NULL, 1, '2022-10-14 18:04:25', '2022-10-17 18:01:37'),
(2044, 105433, 'আসসালামু আলাইকুম স্যার,\r\nGST পরিক্ষায় আমরা যারা গণিত দাগিয়েছি তারা প্রশ্ন কঠিন হাওয়ায় তুলনামূলক ভাবে কম নাম্বার পেয়েছি। অন্যদিকে আমাদের  সহপাঠী বন্ধুরা বাংলা /ইংলিশ দাগিয়ে বেশি নাম্বার পেয়েছে।\r\nকিন্তু আমাদের প্রাণের নোবিপ্রবি গণিত না দাগানো শিক্ষার্থীদের প্রকৌশল বিভাগের বিষয় প্রদানের সিদ্ধান্ত নিয়েছে। এতে আমরা গণিত দাগানো শিক্ষার্থীরা চরম হতাশ হয়েছি।\r\nঅতএব মহোদয়ের নিকট আকুল আবেদন এই যে, গণিত দাগানো ব্যতিত ইন্জিনিয়ারিং সাব্জেক্ট ও গণিত রিলেটেড না দেওয়া অনুরোধ জানাচ্ছি। আশা করি মহোদয় বিষয়টি বিবেচনা করবেন। ধন্যবাদ', NULL, NULL, 1, '2022-10-14 19:30:58', '2022-10-17 17:51:59'),
