(2046, 116583, 'স্যার আমার প্রথম gst mark এবং বর্তমান gst mark এর মধ্যে গরমিল রয়েছে।আগে গণিতে 1 ছিল বর্তমানে -.025 physics এ পূর্বে 7.50 বর্তমানে 8.75 দয়া করে সমাধান করলে কৃতার্থ হবো। \r\n  অতসী শর্ম্মা।', NULL, NULL, 1, '2022-10-14 20:34:10', '2022-10-17 17:20:43'),
(2047, 122954, 'আসসালামু আলাইকুম,\r\nস্যার এই পর্যন্ত প্রায় সব বিশ্ববিদ্যালয় গণিত ছাড়া ইন্জিনিয়ারিং ও গণিতের সাথে সম্পর্কিত বিষয় দেয়নি(সার্কুলার অনুযায়ী)। নবিপ্রবি যদি গণিত ছাড়া গণিতের সাথে সম্পর্কিত বিষয় দেয় তাহলে তা কখনোই ভালো ফল বয়ে আনবে না। এতে করে শুধুমাত্র নবিপ্রবির মানই খারাপ হবে। আশা করি স্যার আমাদের বিষয়টি গুরুত্ব দিবেন এবং সার্কুলার পরিবর্তন করবেন। স্যার বিষয়টা সম্পূর্ণ আপনাদের ইচ্ছা। আপনারা চাইলেই সার্কুলার পরিবর্তন করতে পারেন। একটা ছেলে কষ্ট করে গণিতের একটা একটা করে সমস্যা সমাধান করেছে শুধুমাত্র একটা বিষয়ের জন্য। সব বিশ্ববিদ্যালয় জানে গণিত ছাড়া গণিতের সাথে সম্পর্কিত বিষয় দেয়া যায় না। থার্ড ক্যাটাগোরীর বিশ্ববিদ্যালয়গুলোও তাদের বিশ্ববিদ্যালয়ে গণিত ছাড়া গণিতের সাথে সম্পর্কিত বিষয় দিবে না সার্কুলারে বলে দিয়েছে। দয়া করে আমাদের দাবি মানুন।', NULL, NULL, 1, '2022-10-15 00:17:53', '2022-10-17 17:51:24'),
