(2091, 194463, 'আসসালামুয়ালাইকুম\r\nআমি ২০২১-২০২২ শিক্ষাবর্ষে গুচ্ছে উত্তীর্ণ একজন শিক্ষার্থী।আমার বাড়ি নোয়াখালী অঞ্চলে হওয়ায় ছোটবেলা থেকে আমার ইচ্ছা নোবিপ্রবিতে পড়াশোনা করে আর্ন্তজাতিক পর্যায়ে এই প্রতিষ্ঠানকে তুলে ধরা।কিন্তু প্রকাশিত ভর্তি বিজ্ঞপ্তিতে জিপিএর উপর ১০০ নম্বর রাখায় গুচ্ছে উত্তীর্ণ হয়েও নোবিপ্রবিতে পড়ার সুযোগ আমাদের হবে না।করোনা পরিস্থিতির কথা আমলে নিয়ে যেখানে অন্যান্য বিশ্ববিদ্যালয় জিপিএর উপর কোনো নম্বর রাখেনি সেখানে নোবিপ্রবির এমন সিদ্ধান্ত যেন একগুচ্ছ হতাশা।\r\nতাই কর্তৃপক্ষের প্রতি আকুল আবেদন করোনার পরিস্থিতির ও আমাদের মানসিক অবস্থার  কথা চিন্তা করে  অন্যান্য বিশ্ববিদ্যালয়ের মত নোবিপ্রবিতেও জিপিএর উপর যাতে কোনো নম্বর না রাখা হয়।', NULL, NULL, 1, '2022-10-15 19:03:35', '2022-10-17 17:46:51'),
