(2587, 240671, 'আমি একজন ভর্তিচ্ছু শিক্ষার্থী । NSTU এর ওয়েবসাইটে প্রবেশ করে ভর্তির জন্য আবেদন করতে চাচ্ছিলাম । কিন্তু আমি প্রবেশ করতে পারছি না। GST ID and Password দিয়ে লগ ইন করার পরবর্তী পেজে ফোন নাম্বারে একটা কোড আসার কথা । কিন্তু আমি বারবার চেষ্টা করার পরেও আমার নাম্বারে কোনো কোড আসছে না । আমার নাম্বার সচল এবং অন্যান্য ভার্সিটির কোড সাথে সাথে চলে আসে , কিন্তু শুধু  NSTU এর Code আসে না। এই সমস্যাটির কারণ কি ? যা-ই-হোক , তাড়াতাড়ি সমাধাণ করলে উপকৃত হই ।', NULL, NULL, 1, '2022-10-19 03:45:57', '2022-10-19 16:29:32'),
