(2653, 114425, 'ধরেন কেউ যদি jnu তে cse পায় আর sust এ mechanical পায় এখন সে sust এ eee পড়তে চায় তাহলে সে যদি জগন্নাথে cse তে নিশ্চায়ন করে তবে সে sust এ eee পাওয়ার চান্স পুরোই হারালো যেহেতু sust এর মেরিট থেকে বাদ পড়ে যাবে,অথচ সে sust এ মাইগ্রেশন হলে সে eee পেতে পারতো\r\nএখন সে যদি আবার জগন্নাথে ভর্তি না হয়ে সাস্টে মেকানিক্যালে ভর্তি হয় এই আশায় যে মাইগ্রেশন হয়ে eee আসবে আর পরে তা না আসে তবে তো দুইটাই গেল জগন্নাথের cseও গেল sust এর eeeও গেল \r\nএটা কেমন অবিচার\r\nThe Daily Campus :\r\nভর্তিচ্ছুদের এসব প্রশ্নের ব্যাখ্যায় কর্তৃপক্ষ বলছে, প্রকাশিত প্রথম মেধাতালিকায় একজন ভর্তিচ্ছু তার নম্বর অনুযায়ী ৩-৪ যায়গায় সাবজেক্ট পাবে। ধরুন সে জগন্নাথ বিশ্ববদ্যিালয়ে জুলজি, খুলনা বিশ্ববিদ্যালয়ে রয়াসন এবং যশোর বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ে তড়িৎ ও ইলেক্ট্রনিক প্রকৌশল পলে। তখন সে ৫ হাজার টাকা দিয়ে যবিপ্রবির ইইই-তে ভর্তি নিশ্চায়ন করলেন। তাহলে সে জবি আর খুবি থেকে বাদ হয়ে যাবেন।\r\nএরপর দেখা গেল ২য় মেধাতালিকায় ওই ভর্তিচ্ছু শাহজালাল বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ে বায়োকেমিস্ট্রি পেলেন। তখন সে চাইলে যবিপ্রবি থেকে শাবিপ্রবিতে মুভ করতে পারবেন।\r\nকর্তৃপক্ষের কথা অনুযায়ী ঐ ছাত্রটি 1st merit এ শাবিপ্রবির বায়োকেমিস্ট্র পেলে সে যেহেতু যবিপ্রবির ইইই তে নিশ্চায়ন করবে তাই জবি আর খুবির মতন শাবিপ্রবির থেকেও বাদ হয়ে যাবে অর্থাৎ তার খুবি,জবি,শাবিপ্রবি কোনোটাতেই আর সাবজেক্ট মাইগ্রেশন হতো না।অথচ শুধুমাত্র দ্বিতীয় মেরিটে আসার কারণে সে শাবিপ্রবিতে বায়োকেমিস্ট্রতে মুভ করার সুযোগ পাচ্ছে,যা প্রথম মেরিটে আসলে খুবি ও জবির মতন বাদ হয়ে যেত।অথচ যে প্রথমে মেরিটে শাবিপ্রবিতে বায়োকেমিস্ট্রি পাবে তার নাম্বার দ্বিতীয় মেরিটে যে শাবিপ্রবিতে বায়োকেমিস্ট্রি পাবে তার চেয়ে অবশ্যই বেশি থাকবে। এতে কি দাঁড়ালো যে কম নাম্বার পেয়েও দ্বিতীয় মেরিট থেকে একজন শিক্ষার্থী শাবিপ্রবিতে ভালো সাবজেক্ট পেলো যা প্রথম মেরিটে আসা শিক্ষার্থী বেশি নাম্বার পেয়েও পেল না', NULL, NULL, 1, '2022-10-19 08:18:49', '2022-10-19 11:33:49'),
