(2856, 194086, 'গুচ্ছ ভর্তি পরীক্ষায় বেশি নাম্বার পাওয়া শর্তেও জিপিএ নাম্বারের কারণে আমরা পিছিয়ে যাবো।ধরুন আমি গুচ্ছ ভর্তি পরীক্ষায় ৪৮.২৫ পেয়েছি, জিপিএ নাম্বার সহ আমার ফলাফল আসলো ১৪০.৪ অন্যদিকে যে গুচ্ছ ভর্তি পরীক্ষায় ৪১ পেয়েছে, সে জিপিএ নাম্বারসহ পেয়েছে ১৪১। সে আমার থেকে এগিয়ে গেল। অর্থাৎ আমি গুচ্ছ ভর্তি পরীক্ষায় বেশি নাম্বার পেয়েও পিছিয়ে গেলাম। তাই জিপিএর থেকে গুচ্ছ নাম্বারকে প্রাধান্য দিলে ভালো হতো। দয়া করে আমার আবেদনটা যাচাই করে মঞ্জুর করিবেন।', NULL, NULL, 1, '2022-10-20 03:48:47', '2022-10-20 07:33:38'),
