(3030, 150367, 'নগদ এ পেমেন্ট করা হয়েছে একবার।টাকা একাউন্ট থেকে কেটে নেওয়া ও হয়। ফোন এ মেসেজ দেওয়াও হয় যে টাকা কাটা হয়েছে।কিন্তু বিশ্ববিদ্যালয় ওয়েবসাইটে আনপেইড দেখানো হয়।এরপর দ্বিতীয়বার পেমেন্ট করা লাগলো। \r\n।সুতরাং ৫০০+৫০০ =১০০০ টাকা দেওয়া হলো। যেই ৫০০ এক্সট্রা নেওয়া হলো তার সমাধান কি?', NULL, NULL, 1, '2022-10-20 21:17:22', '2022-11-10 20:22:38'),
