(3075, 112465, 'Assalamu Alaikume.\r\n১.আমি অন্য আরেক জায়গায় এডমিট আছি।এখন ভর্তির দিন ফটোকপি ও অন্য জায়গায় কাগজ জমাদানের জন্য প্রমাণ দেখালে কি কিছুদিন সময় পাওয়া যাবে?এবং পুরো টাকা জমাদানের সময় কাগজ জমা দিবো।\r\n\r\n২. মাইগ্রেশনে প্রসেসটার ব্যাপারে বললে ভালো হয়।যদি আমি তিন জায়গায় এপ্লাই করি ;তিন জায়গায় সাবজেক্ট আসলো।একটির ভর্তি নিশ্চায়ন করলাম,...\r\n* বাকিগুলো কি বাদ হয়ে যাবে একবারে!?\r\n* নাকি বাকিগুলোর ঐ সাবজেক্টে আর ভর্তি হওয়া যাবে না ও সামনের সাবজেক্টে মাইগ্রেশান হবে?', NULL, NULL, 1, '2022-10-21 02:19:18', '2022-11-10 23:58:33'),
