(3083, 511531, 'আসসালামু আলাইকুম স্যার।\r\nআমি নির্দেশনা মোতাবেক নগদ একাউন্ট (০১৯১১০৬৯০২২) থেকে  পেমেন্ট করলেও আমাকে পেমেন্ট স্লিপে না নিয়ে আবারও লগিন পেজে রিডিরেক্ট করে। কিন্তু আমার ৫০৫ টাকা ব্যালেন্স কেটে নেয়। পরবর্তীতে আবার পেমেন্ট করলে তখন পেমেন্ট সম্পন্ন হয়। \r\nএ অবস্থায় আমার প্রথম পেমেন্টের টাকা রিফান্ড করার ব্যবস্থা করতে আপনার মর্জি হয়।', NULL, NULL, 1, '2022-10-21 08:53:47', '2022-11-10 20:17:29'),
