(3168, 220118, 'জিএসটি  ওয়েবসাইট  আমার মোবাইল নাম্বার পরিবর্তন করেছি,কিন্তু এনএসটিইউ ওয়েবসাইটে  এখনো আমার \r\nপরিবর্তনকৃত মোবাইল নাম্বার  দেখাচ্ছে  না, যার জন্য  পরিবর্তনকৃত  মোবাইল নাম্বারের  ওটিপি পাওয়া যাচ্ছে  না।  এই কারণে এডমিশন আবেদন করতে পারছিনা।', NULL, NULL, 1, '2022-10-21 14:40:33', '2022-10-21 16:53:36'),
(3169, 222547, 'স্যার আমার ওটিপি আসছে না,\r\nআগে কয়েকবার ট্রাই করছিলাম রকসাথেই অনেক ওটিপি আইসিলো,এখন একটাও আসে না আবেদন ও করতে পারি না।', NULL, NULL, 1, '2022-10-21 14:46:42', '2022-10-21 16:54:02'),
(3170, 125047, 'স্যার, আমি নোবিপ্রবিতে এগ্রিকালচার, সিএসই, ইকনোমিক্স, ইংরেজি মতো কিছু পছন্দের সাবজেক্ট পড়তে চাই। কিন্তু চয়েস দেওয়ার সময় সবগুলো সাবজেক্ট পছন্দক্রমে দিতে হচ্ছে(যেগুলো আমি পড়তে চাইনা)।এখন প্রথম মেরিটে তুলনামূলক অপছন্দের সাবজেক্ট যদি পেয়ে যাই এবং ভর্তি নিশ্চায়ন না করি তাহলে সম্ভাবনা থাকলেও মাইগ্রেশন হয়ে পছন্দের সাবজেক্ট পাওয়া থেকে বঞ্চিত হবো। আবার যদি ভর্তি হয়ে যাই, পরবর্তীতে আমি পছন্দের প্রথম সাবজেকটি নাও পেতে পারি। ফলত আমাকে অন্য বিশ্ববিদ্যালয়ে ভর্তি না হওয়ার জন্য ওখানকার মাইগ্রেশন থেকে বঞ্চিত হতে হবে। তাই আমি চাই আমকে সবগুলো সাবজেক্ট চয়েস হিসাবে দিতে বাধ্য না করে যেগুলো পড়তে চাই সেগুলোই দেয়ার সুযোগ দেয়া হোক। এ সুবিধা সাস্ট, খুবি, ইবি সহ আরও কয়েকটি বিশ্ববিদ্যালয় দিচ্ছে৷\r\n\r\nতাই আপনাদের প্রতি অনুরোধ,এ ব্যাপারে প্রয়োজন অনুযায়ী ব্যবস্থা নিয়ে আপনাদের সফটওয়্যারে পরিবর্তন এনে বাধিত করবেন। \r\n\r\nনিবেদক \r\nজান্নাতুন নেসা\r\nজিএসটি আইডি- ৩৬০০৫১০ \r\n০১৯৯১৩২৫৩১৭', NULL, NULL, 1, '2022-10-21 15:01:13', '2022-10-21 20:08:10'),
