(3284, 364425, 'আমি আমার আগের মোবাইল নামবার পরিবর্তন( 01740390898) করে নতুন মোবাইল নামবার(01866185740) দিয়েছি, ,, মোবাইল নামবার টি গুচ্ছ ওয়েবসাইট এ পরিবর্তন হলেও আপনাদের বিশ্ববিদ্যালয়ের ভতি ওয়েবসাইটে এখনো পরিবর্তন হয়নি, তাই আমি ভতি আবেদন সম্পূর্ণ করতে পারছি না। অতএব, আপনার নিকট আকুল আবেদন আমার নতুন নামবার টি সংযুক্ত করে সহায়তা করবেন। নিবেদক মোছাঃ আফজানা আক্তার আখি গুচ্ছ পরীক্ষায় উত্তীর্ণ শিক্ষার্থী গুচ্ছ পরিক্ষা রোলঃ৩৬৪৪২৫ এপ্লিকেশন আইডিঃ ৩৭৭৬৮২১ এইচএসসি রোলঃ ২৭৩৭১৪ বোর্ডঃদিনাজপুর পাসের বছরঃ২০২০ আগের মোবাইল নামবারঃ০১৭৪০৩৯০৮৯৮ পরিবর্তনকৃত এখন নতুন নামবারঃ০১৮৬৬১৮৫৭৪০\r\n\r\nআমি লগিইন করার সাথে আগের নামবারটি দেখতে  পাই,, আগের নামবার  টি এখনো পরিবর্তন  হলো না তিনদিন আগে অভিযোগ  দেয়ার পর ও,, আমি তো আবেদন  করার জন্য লগিইন করে ডুকতে পারছি,,  সেই আগের  নামবার  এ ওটিপি  যায়,', NULL, NULL, 1, '2022-10-21 23:01:39', '2022-10-22 19:19:04'),
