(3958, 128050, 'আসসালামু আলাইকুম \r\nদয়া করে রিপ্লাই দিবেন\r\nধরুন কেউ sust এ বিজ্ঞান বিভাগে subject choice দিলো civil Engineering >EEE>IPE এই তিনটা। এবং সে অন্য আর কোনো varsity তে আবেদন  করলনা। উল্লেখযোগ্য যে sust website এ আবেদনের সময় কয়েকটি সাবজেক্টের choice ও দেয়া যাচ্ছে। বাকি গুলা না দিলেও হচ্ছে।তবে এই অবস্থায় আমার প্রথম মেরিটএ subject না আসলে কি আমি আর ভর্তির জন্য  বিবেচিত হবোনা?যদিও ওই number এ আমার 2ndnd মেরিটে সাব্জেক্ট আশার সম্ভাবনা ছিলো। \r\nমোটকথা সাব্জেক্ট না আসলে তো আমি ভর্তি হতে পারছিনা।তখন কি  আমি migration এর জন্য বিবেচিত হবো?\r\nদয়া করে সঠিক তথ্য দিয়ে সহযোগিতা করবেন।এটা আমার জন্য খুবই গুরুত্বপূর্ণ।', NULL, NULL, 1, '2022-10-25 12:46:28', '2022-10-25 21:42:15');
