(4167, 198538, 'অন্যান্য সকল বিশ্ববিদ্যালয়ে আবেদন করা স্বাভাবিক হয়েছে। নোয়াখালী বিজ্ঞান প্রযুক্তি বিশ্ববিদ্যালয় এ আব্দনের জন্য এপ্লিকান্ট আইডি পাসওয়ার্ড দেওয়ার পর মোবাইলে ওটিপি যাচ্ছে না।অনেকবার চেষ্টা করেছি। মোবাইল নেটওয়ার্ক স্বাভাবিক আছে।\r\nসম্ভবত এই ভার্সিটির ওয়েবসাইট এ সমস্যার কারনে ওটিপি পাঠাচ্ছে না।\r\nআবেদনের সময় আর মাত্র ১ দিন। দ্রুত সময়ে সমস্যা টা সমাধান করার জন্য টেকনিক্যাল কমিটির কাছে অনুরোধ করছি\r\nশারাবান তাহুরা \r\nজিএসটি আইডি ২১৫৯৩১২', NULL, NULL, 1, '2022-10-25 20:41:48', '2022-10-26 14:11:45'),
