(4208, NULL, '* ধরুণ আপনার স্কোর ৭২+ এবং আপনি সাস্ট,যাস্ট,আর জবিতে টপ লিষ্টে সিএসই রাখছেন।এখন আপনার স্কোর যেহেতু ভালো সেহেতু এই তিন বিশ্ববিদ্যালয়েই আপনি প্রথম মেরিটে সিএসই পাবেন,কিন্তু আপনি তো যেকোন একটায় ভর্তি হবেন,তাই বাকি দুটি বিশ্ববিদ্যালয় থেকে আপনি বাদ যাবেন,কারণ সিএসই এর উপর আর কোন সাব্জেক আপনার চয়েজ লিষ্টে নাই, যার ফলে বাকি দুটি বিশ্ববিদ্যালয়ে আপনার আর মাইগ্রেশনের সুযোগ নেই,এইজন্য বাদ পড়ে যাবেন।\r\n*এখন আপনার স্কোর ৬৫+ আপনি সাস্ট,যাস্ট আর এনএসইউ তে টপ সব্জেক্ট রাখলেন,সাস্টে সিএসই,যাস্টে ইইই,এবং এনএসইউ তে সিএসই। \r\nএখন কোথায় আপনি প্রথম মেরিটে টপ সাব্জেক্ট পেলেন না।সাস্টে আসলো ME,যাস্টে আসলো Civil  আর এনএসইউ তে আসলো ইইই। \r\nএখন আপনি এনএসইউ তে ভর্তি হলেন।তাহলে আপনি সাস্ট এর ME,এবং যাস্টের Civil সাব্জেক্টটি পাবেন না,কিন্তু চয়েজ লিষ্টের উপরের সাব্জেক্টটিতে মাইগ্রেশব হবে,এতে করে আপনি সাস্ট আর যাস্ট থেকে বাদ পড়বেন না।\r\n*এখন মনে করেন আপনি তিনটা বিশ্ববিদ্যালয়ে প্রথম মেরিটে তুলনামূলক কম জনপ্রিয় সাবজেক্ট কিন্তু তিনটি বিশ্ববিদ্যালয়েই পেয়েছেন,সেক্ষেত্রে আপনি একটাতে ভর্তি হবেন,অন্যথায় গুচ্ছ থেকে বাদ পড়ে যাবেন।এবং ভর্তির পর  বাকি দুইটায় অটো মাইগ্রেশন হবে উপরের দিকে,এখন মনে করুন ২য় মাইগ্রেশনে আপনি বাকি দুইটার মধ্যে যেকোন একটায় ভালো সাবজেক্ট পেলেন, ফলে আপনি যেখানে ভর্তি সিলেন যেখানে ভর্তি বাতিল করে ভালো সাবজেক্টের ইউভি  তে আসলেন, সেক্ষেত্রে যে বিশ্ববিদ্যালয়ে ভর্তি ছিলেন সেটা থেকে বাদ পড়বেন এবং সেখানে আর মাইগ্রেশন হবেনা।\r\nবাকি দুইটায় মাইগ্রেশন হবে।\r\n* এখন প্রথম মেরিটে কোথায় সাবজেক্ট না আসলে ২য় মেরিটে আসতে পারে, অথবা ৩য় মেরিটে।', 'Md. Jane Alam Adnan (mishu)', 128050, 0, '2022-10-25 21:42:15', '2022-10-25 21:42:15'),
