(5292, 523069, 'বরাবর\r\nতথ্য ও অভিযোগ কেন্দ্র \r\nনোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়,\r\nনোয়াখালী। \r\nবিষয়ঃ অতিরিক্ত ফি ফেরত প্রদানের আবেদন প্রসঙ্গে। \r\nজনাব\r\nআমি মোঃ ফয়সাল আহাম্মেদ রিদয়, উক্ত বিশ্ববিদ্যালয়ের ভর্তির আবেদনের টাকা পেমেন্ট করার সময় দুইবার OTP দেই। সেজন্য নগদ নাম্বার- ০১৫৩৩৩৯৪৩০৭ থেকে ২বার ৫০০৳ কেটে নেয়। যা শুধু একবার কাটার কথা ছিল। এই ব্যপারে ভার্সিটির তথ্য কেন্দ্র থেকে আমাকে ফোন করে নিশ্চিত করা হয়েছিল।\r\nঅনুগ্রহ পূর্বক,আমার আবেদনটি বিবেচনা করে টাকা উক্ত নাম্বারে প্রদান করবেন বলে আশা করছি।\r\n\r\nনিবেদক\r\nমোঃ ফয়সাল আহাম্মেদ রিদয়', NULL, NULL, 1, '2022-11-02 17:53:29', '2022-11-10 20:23:19'),
(5293, 141761, 'স্যার কবে টাকা আসবে?', NULL, NULL, 1, '2022-11-02 19:29:18', '2022-11-10 20:22:56'),
(5294, 178616, 'স্যার আবেদন শেষ হয়েছে 6 দিন হলো। আমি আমার টাকাটা এখনো ফেরত পায়নি। ০১৯৮৭২৮৫২২৭ এই নাম্বার থেকে আমার টাকা গেছে। আমার সমস্যাটা সম্পর্কে আপনারা অবগত। বলা হয়েছিল আমার টাকা রিভার্স দেওয়া হবে। আসলে কি আমার টাকাটা পাবো।', NULL, NULL, 1, '2022-11-03 11:09:04', '2022-11-10 20:22:11'),
(5295, 192696, 'আমি যেভাবে সাবজেক্ট চয়েস দিয়েছিলাম সেভাবে আমার চয়েস আসেনি। আমার দেয়া সাবজেক্ট চয়েস এর এনোলজমেন্ট স্লিপ আছে আমার কাছে।দয়া করে আমার সাবজেক্ট চয়েস সেভাবে আপডেট করুন।', NULL, NULL, 1, '2022-11-03 14:17:50', '2022-11-24 18:29:13'),
