(5355, 192108, 'স্যার, মাইগ্রেশন নিয়ে চিন্তা করতে করতে এইটা একধরনের মানসিক সমস্যায় পরিণত হয়েছে,স্যার আমি PSTU তে CSE পাইছি এবং NSTU তে Micobio পাইছি,,আমার সিএসই নিয়ে পড়ার তীব্র ইচ্ছে,,স্যার আমি যদি PSTU তে ভর্তি হয় তাহলে ও কি NSTU তে আমার মাইগ্রেশান চলতে থাকবে,কারণ নিঃসন্দেহে PSTU র সিএসই থেকে NSTU র সিএসই ভালো,,,গুচ্ছ এর কেন্দ্রীয় নোটিসে ও এই মাইগ্রেশন এর ব্যাপারটা এতটা ডিটেইলস বলা হয় নাই,', NULL, NULL, 1, '2022-11-04 18:41:23', '2022-11-04 18:48:20'),
