(5463, 254927, 'বিশ্ববিদ্যালয় মাইগ্রেশন সম্পর্কে বিস্তারিত জানানোর জন্য অনুরোধ করছি\r\n\r\nমনে করুন, আমি জাস্টে ইইই সাবজেক্ট চয়েস লিস্টে সবার আগে রেখেছিলাম এবং ইইই বিষয়েই ৫০০০ টাকা ভর্তি নিশ্চায়ন ফি দিয়ে ভর্তি হলাম। একই সাথে আমি সাবজেক্ট মাইগ্রেশন ও বিশ্ববিদ্যালয় অন রাখলাম তুলনামূলক ভালো বিশ্ববিদ্যালয় এবং সাবজেক্টের আশায়। পরবর্তী মাইগ্রেশনে সাস্টে ভূগোল আসলো। যেহেতু আমি বিশ্ববিদ্যালয় মাইগ্রেশন অন রেখেছিলাম, এখন কি আমাকে সাস্টের ভূগোল নিয়েই পড়তে হবে? আমি ইউনিভার্সিটি মাইগ্রেশন অন রেখেছিলাম ঠিক আছে, আমি তো একই সাথে একাধিক সাবজেক্টে ভর্তি থাকছি না। জাস্টের ইইই বিষয়ে ভর্তি থাকা কি বাতিল হয়ে যাবে? কারণ আমি তো সাস্টের ভূগোল বিষয়ে ভর্তি হচ্ছি না , তাহলে কেন জাস্টে ভর্তি থাকা বাতিল হবে?\r\n\r\nআমি গুচ্ছের মাইগ্রেশনের ব্যপারে বিস্তারিত পড়েছি, পড়ার পরেও সম্পূর্ণ ক্লিয়ার না হওয়ায় পুনরায় জিজ্ঞাসা করলাম। আমার এখানে করা প্রশ্নটির উত্তর দিলেই কৃতজ্ঞ থাকবো।', NULL, NULL, 1, '2022-11-06 11:54:05', '2022-11-08 14:05:12'),
