(5602, 107385, '১ম মেরিটে কেউ আবেদনকৃত ৬ টার মধ্যে ৪ টা বিশ্ববিদ্যালয়ে সাবজেক্ট পেয়ে একটাতে ভর্তি হয়ে ভার্সিটি মাইগ্রেশন অন রাখলো। তাহলে সে কি পরবর্তীতে সাবজেক্ট পেয়েও ভর্তি না হওয়া গুলোতে পুনরায় সাবজেক্ট পাবে? যদি পায় তাহলে তো মাইগ্রেশন যতগুলোই হোক প্রতিবারই একজনই বারবার একই বিশ্ববিদ্যালয়ে সাবজেক্ট পাবে।প্রতিবারই একজনই ৭/৮ টা করে সিট দখল করে রাখবে।প্রসেস টা অনেক লং হবে, অনেক মাইগ্রেশন হবে,তবুও অন্যরা সিট পাবে না,একজনই বারবার পাবে।ভার্সিটি মাইগ্রেশন টা কি এই প্রক্রিয়ায়ই হবে???', NULL, NULL, 1, '2022-11-10 23:25:41', '2022-11-11 00:01:16'),
