(5622, 134901, 'স্যার, আমি ইবিতে সিএসইতে ভর্তি আছি ।এখন নবিপ্রবিতে সিএসই পেলে এইখানেই চূড়ান্ত হয়ে ভর্তি হতে চাই ।সে ক্ষেত্রে কি আমার মূল কাগজপত্র তুলে এনে আবার জমা দিতে হবে? জিএসটি ওয়েবসাইট এ বলতেছে মূল কাগজপত্র জমা দেওয়ার প্রয়োজন হবে না।আর আপনাদের ওয়েবসাইটে বলতেছে যে ,দিতে হবে।\r\nকোনটা সঠিক?', NULL, NULL, 1, '2022-11-12 10:57:27', '2022-11-15 18:31:16'),
(5623, 134901, 'আমি ইবির সিএসই থেকে মাইগ্রেশন করে নবিপ্রবিতে সিএসই পেলে চূড়ান্তভাবে ভর্তি হতে চাই। ভর্তির জন্য প্রয়োজনীয় আমার সকল কাগজপত্র ইবি তে জমা আছে ।\r\nনবিপ্রবি এ চূড়ান্তভাবে ভর্তির সময় কি এগুলো ইবি থেকে উত্তোলন করতে হবে?', NULL, NULL, 1, '2022-11-12 12:45:27', '2022-11-15 18:31:16'),
