(5640, 134901, 'জিএসটির নোটিশে বলতেছে যে, চূড়ান্ত ভর্তি সময় শিক্ষার্থীকে মূল কাগজপত্র নিজ দায়িত্বে সংগ্রহ করে  চূড়ান্ত ভাবে নির্বাচিত বিশ্ববিদ্যালয় এ জমা দিতে হবে।\r\n আর আপনি বলতেছেন যে প্রাথমিক ভর্তির সময়ই মার্কশিট জমা দিতে হবে। মানে চূড়ান্ত ভর্তি সময়ে মূল কাগজপত্র গুলো কি কেন্দ্রীয়ভাবে স্থানান্তর করা হবে নাকি আমার হস্তক্ষেপ করা লাগবে মাথায় ঢুকতেছে না\r\nব্যাপারটা ক্লিয়ার হল না। ব্যাপারটা একটু ক্লিয়ার করে বুঝিয়ে বললে উপকৃত হই।', NULL, NULL, 1, '2022-11-14 09:39:44', '2022-11-15 18:31:16'),
(5642, NULL, 'প্রাথমিকভাবে যে বিশ্ববিদ্যালয়ে ভর্তি হবেন সেখানে মূল মার্কশিট জমা দিতে হবে, সকল প্রকার মাইগ্রেশন শেষে চূড়ান্তভাবে যে বিশ্ববিদ্যালয়ে ভর্তি হবেন, তা যদি প্রাথমিকভাবে ভর্তি কৃত বিশ্ববিদ্যালয় থেকে ভিন্ন হয় তবে প্রাথমিকভাবে ভর্তি কৃত বিশ্ববিদ্যালয় থেকে স্বশরীরে এসে মূল মার্কশিট তুলে চূড়ান্তভাবে ভর্তি কৃত বিশ্ববিদ্যালয়ে জমা দিতে হবে', 'Md. Iftekharul Alam Efat', 134901, 0, '2022-11-14 09:52:31', '2022-11-14 09:52:31'),
