(5683, 538681, 'আসসালামু আলাইকুম, আমার গুচ্ছ রোল ৫৩৮৬৮১। আমি প্রথম মেরিট লিস্টে নোয়াখালী বিজ্ঞান প্রযুক্তি বিশ্ববিদ্যালয়ে  কোনো সাবজেক্টের জন্য মনোনীত হই নি। এমন কি যে কয়টি বিশ্ববিদ্যালয়ে আবেদন করে ছিলাম সেখানে কোনো বিশ্ববিদ্যালয়ে কোনো সাবজেক্টের জন্যও মনোনীত হই নি। কিন্তু নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ে দ্বিতীয় মেরিন লিস্টে আমাকে ভর্তি বাতিল দেখাচ্ছে। কিন্তু কেনো দেখাচ্ছে আমি এই বিষয়ে অবগত নই।আমাকে যদি এই ব্যাপারে অবগত করা হয় তাহলে আমি উপকৃত হতাম।', NULL, NULL, 1, '2022-11-16 20:03:50', '2022-11-17 18:30:20'),
