(5713, 133142, 'আস্সালামু আলাইকুম। স্যার এখন যে ভার্সিটি মাইগ্রেশন হচ্ছে, এটা যদি চলতে থাকে তাহলে তো ওয়েটিং থেকে খুব কম টানবে।প্রতি মেরিটে ৪৫-৫০ জন করে টানা হবে। কারণ, ভর্তি না হলেও তো মাইগ্রেশন চলতেছে। আমরা যারা 55-59 নাম্বার পাইছি,তারা কবে সাবজেক্ট পাবো?এদিকে মেরিট লিস্টও অনেক দিন পরপর প্রকাশ করতেছেন। দয়া করে ২য় মেরিটের পরে 3,4 দিন পর পর মেরিট দেয়ার ব্যবস্থ করুন অথবা ভার্সিটি মাইগ্রেশন বন্ধ করুন। যে যেখানে ভর্তি হবে, তার শুধু সেখানেই মাইগ্রেশন চলুক। বর্তমান যেভাবে চলতেছে, একজন শিক্ষার্থী ৫-১০ টায় সিট দখল করে আছে। আবার ৫-১০ টাতেই মাইগ্রশন চলতেছে। তাহলে নতুন শিক্ষার্থী টানবে কিভাবে? টানলেও ৫০ জনের এর বেশি না।আরেকটা অনুরোধ গত বছরের মতো সিট ফাকা রেখে ভর্তি বন্ধ করবেন না। কেননা জানুয়ারি তে ক্লাস শুরু করলে কিভাবে সিট ফিল আপ হবে আর কয়টাই বা মেরিট লিস্ট যাবে তা আমার জানার উর্ধে সুতরাং দয়া করে ভার্সিটি মাইগ্রেশন বন্ধ করে  স্বল্প সময়ে ভর্তি কার্যক্রম শেষ করুন। ধন্যবাদ', NULL, NULL, 1, '2022-11-17 13:28:54', '2022-11-18 13:32:46'),
