(5871, 113086, 'বুঝলাম ফাঁকা নাই। কিন্তু এখনো ট্যুরিজম কেন?  এটাতো আমি প্রথম মেরিটেই পাইসিলাম।যেহেতু ভর্তি হই নি, আমার এটা আর কখনোই পাওয়ার কথা না। \r\n\r\n\r\nগুচ্ছের অফিসিয়াল ওয়েবসাইটে মাইগ্রেশান প্রসেসে এটাই বলা আছে। আপনারা বিষয়টা নিয়ে একটু চিন্তা ভাবনা করবেন দয়া করে। ধন্যবাদ।', NULL, NULL, 1, '2022-11-24 13:21:12', '2022-12-14 19:52:00'),
