(5873, 107726, 'আসসালামু আলাইকুম।  আমি এইচ.এস.সি ২১ ব্যাচের ছাত্রী। গুচ্ছে আমার মার্ক অনেক কম।  তারপরেও পাবলিক বিশ্ববিদ্যালয়ে পড়ার জন্য এত মাস আমরা অপেক্ষা করেছি।  আপনারা ই বলুন এত ভোগানৃতি কেন?  পরিবারের সবাই ও অনেক চিন্তায় আছে। এত সময় লাগতেছে একমাত্র বাজে মাইগ্রেশন সিস্টেমের জন্য। আপনারা এখনও কেন কোনো সিদ্ধান্ত নিতে পারছেন না বলেন তো প্লিজ। আমরা কম মার্ক পেয়েছি জানি।।  মেরিট ও ভালো হবে না জানি। তাই বলে কি এত অপেক্ষা।  আপনারা প্লিজ দয়া করে কিছু একটা করেন। আমাদের এই মাইগ্রেশন সিস্টেমটা দ্রুত শেষ করেন।  আর সময় নষ্ট করবেন না প্লিজ। নতুন শিক্ষার্থীদের ও সুযোগ দিন।  ধন্যবাদ', NULL, NULL, 1, '2022-11-24 14:27:06', '2022-12-12 13:00:31'),
(5874, 192696, 'একটা মেরিট প্রকাশ করার পরে শুধুমাত্র কাগজপত্র জমা দেয়ার জন্য ৫-৬ দিন সময় দেয়া আমাদের মতো ছাত্রদের অপেক্ষার প্রহর বাড়াবে।আমি নোবিপ্রবির একজন ছাত্র হিসেবে (গতবার জিএসটির মাধ্যমে ভর্তি হওয়া) অন্তত এতটুকু বলতে পারি প্রথম মেরিটের ৮০% শতাংশ স্টুডেন্টদের জন্যই এ ভর্তি প্রক্রিয়া দীর্ঘায়িত হয়। এজন্য কিছু করা দরকার আর একটা মেরিট প্রকাশের পরে সর্বোচ্চ ৩-৪ দিন সময় দেয়া দরকার কাগজপত্রের জন্য।এভাবে চলতে থাকলে গতবারের চেয়ে এইবার ও ভর্তি প্রক্রিয়া দীর্ঘায়িত হবে।ক্ষমাদৃষ্টিতে দেখবেন যদি ভুল কিছু বলে থাকি।', NULL, NULL, 1, '2022-11-24 15:12:38', '2022-11-24 18:29:13'),
