(5891, 198690, 'আসসালামুআলাইকুম ।নোবিপ্রবিতে কীভাবে সাবজেক্ট মাইগ্রেশন হচ্ছে? প্রথম মেরিটে যে সাবজেক্ট পেয়েছিল এখনও প্রায় অনেকের একই সাবজেক্ট। গুচ্ছের সার্কুলার এ বলা আছে কোনো শিক্ষার্থী ১ম মেরিটে যে সাবজেক্ট পাইছে সে যদি ওই ভার্সিটিতে কনফার্ম না করে পরবর্তীতে ওই সাবজেক্ট আর পাবে না এবং উপরে সিট খালি থাকা সাপেক্ষে মাইগ্রেশন হবে। এছাড়া চয়েজ লিস্টের প্রথম সাবজেক্ট পাওয়ার পরেও কনফার্ম না করলে ওই ভার্সিটি হতে বাদ পরবে। তাহলে নোবিপ্রবিতে কেন মাইগ্রেশন এত কম হচ্ছে? দয়া করে প্রক্রিয়াটা বুঝিয়ে বলবেন।', NULL, NULL, 1, '2022-11-24 19:11:50', '2022-12-14 13:51:59'),
(5892, 107726, 'আপনারা ও তো গুচ্ছের ভার্সিটি নাকি? তাহলে আপনারা কি কিছুই জানেন না।।।। এটা কোনো কথা? এখানে কি কোনো খেলা চলতেছে নাকি? আমাদের ভবিষ্যত নিয়া খেলতেছেন আপনারা।।।  পুরাই ফালতু সিস্টেম।  বিরক্তিকর।', NULL, NULL, 1, '2022-11-24 20:23:26', '2022-12-12 13:00:31'),
(5893, 118781, 'GST নিয়ম অনুযায়ী আমি যদি সাবজেক্ট পাই কনফার্ম না করলে ওই সাবজেক্ট বাতিল গন্য হবে উপরের সাবজেক্ট মাইগ্রেশন চলবে।  ১ম চয়েজ কনফার্ম না করলে ওই ভার্সিটি থেকে বাদ হবে এটা ছিলো GST নিয়ম সবগুলো ভার্সিটি এটাই মেনে চলছে।  কিন্তু আপনারা সাবজেক্ট কনফার্ম না করলেও ওই তার সাবজেক্ট বাদ দিচ্ছেন না তাহলে মাইগ্রেশন হবে কীভাবে। আমি ১ম মেরিটে যে বিষয় পেয়েছি ৩য় মেরিটেও একই। GST নিয়ম অনুসরন করেন দয়া করে🙏🙏', NULL, NULL, 1, '2022-11-24 20:26:06', '2022-12-12 12:59:05'),
(5894, 255774, '৪টি মেরিটে গুচ্ছ ভর্তি প্রক্রিয়া শেষ করা হতে পারে এবং একজন শিক্ষার্থী সর্বোচ্চ তিনবার ভার্সিটি মাইগ্রেশন করতে পারবে এমনটা শুনলাম।এই নিউজটি কতটুকু সঠিক এবং এবিষয়ে কবে ঘোষণা আসতে পারে?\r\nএইক্ষেত্রে আমার একটি প্রশ্ন আছে যা আমি উদাহরণস্বরূপ ভাবে বলছি।ধরুন আমি mbstu,nstu,iu,bu,pstu এই কয়টায় এপ্লাই করেছি।এখন আমার ৪ মেরিট পর্যন্ত শুধু pstu,bu এই দুইজায়গায় সাবজেক্ট আসলো।তাহলে নিয়ম অনুযায়ী আমার যেকোনো একটা ভার্সিটি নিতে হবে।কিন্তু আমার mbstu,nstu,iu এগুলোতে মেরিট লিস্টে নামই আসলো না ৪ মেরিট পর্যন্ত।এমন ক্ষেত্রে কি আমি পরবর্তীতে mbstu,nstu,iu এগুলো থেকে যদি ওয়েটিং থেকে সাবজেক্ট আসে তাহলে সেগুলোতে পরতে পারবো নাকি যেহেতু ৪মেরিটের মধ্য আমার এসব ভার্সিটি আসে নি তাই এসব ভার্সিটি একদম বাদ হয়ে যাবে?আমি বিষয়টি নিয়ে দ্বিধায় আছি।বিষয়টি ক্লিয়ার করলে উপকৃত হতাম।', NULL, NULL, 1, '2022-11-24 20:55:19', '2022-12-03 15:51:15'),
(5895, 195725, 'nstu তে একটা সাবজেক্ট পেয়েও যারা নিশচায়ন করেনি অর্থাৎ অন্য ভার্সিটিতে নিশচায়ন করেছে তাহলে nstu তে পাওয়া সাবজেক্ট থেকে কি তারা বাদ যাবেনা?', NULL, NULL, 1, '2022-11-24 21:13:28', '2022-12-12 18:22:36'),
