(5902, 195725, 'স্যার এমন হলেতো সীট খালিই হবেনা।হলেও অল্প কয়েকটি হবে,কিন্তু যারা সাবজেক্ট পেয়েছে সবাইতো পরবেনা।এখন nstu তে পড়ার ইচ্ছে না থাকা সত্ত্বেও অনেকেই সীট দখল করে আছে।এখন  আমরা যারা পড়তে চাই nstu তে তারাতো পছন্দের সাবজেক্ট পাবোনা যদি এভাবে আপনারা মেরিট দেন।GST এর নিয়মটা অনুসরণ করলে আমাদের খুব উপকার হতো।অন্য সবগুলো ভার্সিটি যেভাবে মেরিট দিচ্ছে সেভাবে nstu তেও দিলে খুব ভালো হতো যারা nstu তেই পড়তে চায় তাদের জন্য।বিষয়টা বিবেচনা করে দেখবেন প্লিজ।', NULL, NULL, 1, '2022-11-24 22:19:20', '2022-12-12 18:22:36'),
(5903, 118781, 'আমি ১ম মেরিট হাজী দানেশ এগ্রিকালচার পেয়েছিলাম যেটা আমার ২য় চয়েজ ছিলো আমি কনফার্ম করিনি দেখে আমাকে ওই বিষয়টি বাদ দেয়া হয়েছে ১ম চয়েছ ছিল ডিভিএম  ( ২য় মেরিটে নাম আমার ছিল না) কিন্ত তারা বলেছে ১ম চয়েজ সিট খালি থাকলে তারা ১ম বিষয়টি দেয়ার চেষ্টা করবে তখন যদি কনফার্ম না করি হাজী দানেশ থেকে বাদ হয়ে যাব আমি। কিন্তু আমাকে তারা এগ্রিকালচার পুনরায় দিচ্ছে না কারন ওই বিষয় আমি কনফার্ম করি নি তাই বাদ দিয়েছে যেগুলো অ্যাপ্লাই করেছিলাম সবগুলো একই নিয়ম অনুসরন করেছে শুধু নোবিপ্রবি ছাড়া আমার সব জায়গায়। আমার বিষয় পরিবর্তন হচ্ছে শুধু নোবিপ্রবি ছাড়া এজন্য প্রশ্নটা করেছিলাম', NULL, NULL, 1, '2022-11-24 22:53:48', '2022-12-12 12:59:05'),
(5904, 107726, 'আমি আপনাদের ভার্সিটির কথা বলি নাই শুধু।  আপনারাু এই কমিটির অংশ। আপনাদের ও তো সবকিছু জানা আছে। আমাদের কিছু দাবি আপনাদের জানানো হয়েছে। প্লিজ এইগুলো একটু দেখেন। আর তাদের সাথে এই বিষয় নিয়ে আলোচনা করেন৷ দয়া করে।  আমাদের ভোগান্তির ব্যাপারে একটু ভাবেন। আমাদের ও সুযোগ দিন।  বেশি মার্ক যারা পেয়েছে সবাই ৫-৬ টা ভার্সিট তে ভর্তি হয়ে আছে। তাহলে আমরা কীভাবে সুযোগ পাব? বলেন তো? আমরা কি আাদৌ সুযোগ পাব? আপনারা ই বলেন৷।।  এটা কি fair?', NULL, NULL, 1, '2022-11-24 23:16:52', '2022-12-12 13:00:31'),
