(5906, 520649, 'স্যার, আমি ১ম মেরিট এ বঙ্গবন্ধু বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় এ সাবজেক্ট পাওয়ার কারনে গুচ্ছ কমিটি নিয়ম অনুযায়ী প্রাথমিক ভর্তি নিশ্চিত করেছি, নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় এ কোটায় আবেদন করেছি, এখন নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় এ পড়তে চাই, কোটায় সাবজেক্ট পেলে আমি নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় এ ভর্তি হবো বঙ্গবন্ধুতে ভর্তি বাতিল করে দিবো, আমাকে কী কোটার ভাইভার জন্য ডাকা হবে?', NULL, NULL, 1, '2022-11-25 01:54:07', '2022-12-12 13:02:00'),
