(5935, 114864, 'জনাব,আমি A গ্রুপ এর ছাত্র। আমার সিরিয়াল ৯৫৭।২০০০ সিরিয়াল এর উপরের ছাত্র বিষয় পাইছে।কিন্তু আমি ৩য় মেধাতালিকায় ও বিষয় পাইনি।কারণ জানালে খুবই উপকৃত হতাম,মেসেজ এ ভুল হলে মাপ করবেন।', NULL, NULL, 1, '2022-11-27 11:32:55', '2022-12-14 19:53:13'),
