(5937, 526096, 'আমার ২য় মাইগ্রেশানে আইন এসেছিল।আর ৩য় মাইগ্রেশানে অর্থনীতি। আমি অর্থনীতি নিয়ে পড়তে চাচ্ছি, তাই মাইগ্রেশান বন্ধ করতে চাচ্ছি। কিন্তু আমার গুচ্ছ ওয়েবসাইটে এখনো আইন দেখাচ্ছে, আর নোবিপ্রবি ওয়েবসাইটে অর্থনীতি দেখাচ্ছে।  এখন আমার করণীয় কী?', NULL, NULL, 1, '2022-11-27 14:01:13', '2022-12-14 19:53:56'),
