(5964, 530417, 'আমি পবিপ্রবিতে  ব্যবসায় প্রশাসন তে ভর্তি আছি। আমার নোবিপ্রবিতে মেরিটে পজিশন ২১০ (সি ইউনিট)। আমার ৩য় মেরিটে নোবিপ্রবিতে বাংলা আসছে। নতুন নোটিশ অনুযায়ী মাইগ্রেশন পদ্ধতিতে যে পরিবর্তন হয়েছে  তাতে আমি যদি এখন নোবিপ্রবিতে বাংলা বিষয়ে মাইগ্রেশন না করি তাহলে কি নোবিপ্রবিতে আর কখনোই সাবজেক্ট আসবেনা। আর আমি কি ব্যবসায় প্রশাসন পাবো পরবর্তী কোন মেরিটে?', NULL, NULL, 1, '2022-11-29 22:25:00', '2022-12-12 12:56:42'),
(5965, 102678, 'আসসালামু আলাইকুম স্যার, \r\nআমি ২০২১-২০২২ শিক্ষাবর্ষে গুচ্ছ ভর্তিচ্ছু শিক্ষার্থী। \r\n\r\n৪র্থ মেরিট থেকে যেহেতু আমাদের নতুন নিয়ম চালু হচ্ছে। সেক্ষেত্রে একটি জটিলতার সমাধানের দাবি জানাচ্ছি। \r\n\r\n  কিছু বিশ্ববিদ্যালয়ে সাবজেক্ট চয়েস লিস্টে  আমাদের পছন্দের বাইরের সাব্জেক্ট চয়েজ করতে হয়েছে (যেমনঃ jnu)।\r\n  কারন বাদ দেওয়ার কোনো অপশন ছিল না। \r\nএখন যদি ঐ সাব্জেক্ট আসে(বাংলা,দার্শনিক etc) তাহলে বেশিরভাগ  সাইন্সের স্টুডেন্ট ভর্তি হবে না। যার কারনে তার অই University একেবারে বাদ হয়ে যাবে। \r\n\r\n subject out option অন করলে চয়েজ লিস্ট থেকে ঐ সব সাব্জেক্ট বাদ দেওয়া যাবে। এই অপশন Rajshahi University তে ছিলো এ বছর।\r\n\r\nতাই গুচ্ছ টেকনিক্যাল কমিটির কাছে আবেদন জানাচ্ছি এই রকম কোন পদক্ষেপ নেওয়ার জন্য। \r\n\r\nধন্যবাদ।', NULL, NULL, 1, '2022-11-30 08:14:44', '2022-12-14 19:57:28'),
(5966, 525280, 'আসসালামু আলাইকুম \r\nমুক্তিযোদ্ধা কোটার ভাইবা কখন শুরু হবে আর সাব্জেক্ট দেয়া হবে  কখন?  \r\nকোটার রেজাল্টের ক্ষেত্রে এতো দেরী হওয়ার কারণে ছাত্র ছাত্রীদের মাঝে হতাশার সৃষ্টি হচ্ছে।  সবার ভর্তি কার্যক্রম মোটামুটি শেষ।  ৩য় মেরিট লিস্ট ও দেয়া শেষ কিন্তু কোটার কোন আপডেট নোটিশ পাওয়া যাচ্ছে না।  যার ফলে চরম হতাশায় আমাদের দিন কাটছে।  তাই বিশ্ববিদ্যালয়ের কতৃকক্ষের নিকট আবেদন যাতে খুব দ্রুত আমাদের এই সমস্যা সমাধান করা হয়।', NULL, NULL, 1, '2022-11-30 12:04:40', '2022-12-12 18:36:38'),
