(5972, 200523, 'যারা ১ম মেরিট থেকে ৩য় মেরিট অব্দি ভার্সিটি এবং সাবজেক্ট পেয়ে আসছে,\r\n\r\n১.৪র্থ মেরিটে কি তাদেরও সাবজেক্ট আসবে?\r\n\r\n২.৪র্থ মেরিটে কি তাদের চূড়ান্ত ভাবে একটা বিশ্ববিদ্যালয় নিশ্চায়ন করতে হবে? নাকি যেগুলোতে আগে সাবজেক্ট পাইছে/যেখানে মাইগ্রেশনের দ্বারা নতুন সাবজেক্ট আসছে, সেগুলোও পরবর্তীতে থাকবে?', NULL, NULL, 1, '2022-11-30 19:46:43', '2022-12-12 18:35:51'),
