(5974, 118333, 'আসসালামু আলাইকুম। nstu এর মাইগ্রশন টা একটু ক্লিয়ার করবেন প্লিজ। একজন ছাত্রের nstu সাবজেক্ট চয়েস ﻿১.cste 2.swe ...... ﻿ ১ম মেরিট এ সে ছাত্র swe পেল।কিন্তু সে অন্য বিশ্ববিদ্যালয়ে প্রাথমিক নিশ্চায়ন করলো।এখন ২য় মেরিট এ nstu তে cste তে সীট খালি হলোনা।তাহলে ২য় মেরিট এ কি সেই ছাত্রের nstu তে swe থাকবে?', NULL, NULL, 1, '2022-12-01 00:32:36', '2022-12-04 09:22:50'),
(5975, 528324, 'স্যার আসসালামু আলাইকুম ,\r\n আমি আমার ২নং সাব্জেক্ট দিয়েছি অর্থনীতি যা আমি ভুলে দিয়ে দিয়েছি। আমার ম্যানেজমেন্ট এন্ড ইনফরমেশন সিস্টেম ২নং এ  দেওয়া উচিত ছিল এবং অর্থনীতি ৩নুং।  আমি অর্থনীতি এবং গণিত এ একদম ভালো না। হইত অর্থনীতি তে চান্স পেলে আমার পক্ষে পড়ালেখা অনেক কষ্টকর হয়ে যাবে। নোয়াখালী বিজ্ঞান ও প্রযুক্তি তে পড়ার অনেক ইচ্ছা। স্যার অনুগ্রহ করে আমার এই বড় ভুল টা আপনি ক্ষমা দৃষ্টি তে দেখে আমার ভুল টা ঠিক করার একটা সুযোগ দিবেন। আমি আপনার প্রতি চিরকৃতজ্ঞ থাকিব।', NULL, NULL, 1, '2022-12-01 04:24:10', '2022-12-04 09:20:31'),
