(5981, 201351, 'আমি এগ্রিকালচারে এডমিট হয়েছিলাম। কাগজপত্র এখনো NSTU তে আছে। পরে ২য় মাইগ্রেশনে আমি সাস্টে এডমিট হয়। শর্তমতে, ৩য় মাইগ্রেশনে আমি এনএসটিইউ থেকে এগ্রিকালচার সাব্জেক্ট থেকে বাদ পড়ার কথা। কিন্তু আমার এখনো এগ্রিকালচার সাব্জেক্ট দেখাচ্ছে। এটা কি সফটওয়্যার এর কোন সমস্যা নাকি আমি এখনো চয়েস লিস্টের উপরের সাব্জেক্ট এর জন্য মনোনিত নাহ ওই জন্য মাইগ্রেশন হচ্ছে নাহ। আর সাব্জেক্ট ও কি বাতিল হচ্ছে নাহ এই কারণে যে আমার পেপারস ওখানে জমা আছে?', NULL, NULL, 1, '2022-12-02 16:06:06', '2022-12-12 12:56:07'),
