(6016, 201351, 'স্যার, বলা হচ্ছে যে ৪র্থ মেধাতালিকা প্রকাশের পর আমাদের একটা ইউনিভারসিটি ফিক্সড করে দেয়া লাগবে। ধরি আমার  NSTU তে দেয়া মেধা তালিকার কোনটাতে আমার সাব্জেক্ট আসে নাই। এই কারণে আমার অন্য ইউনিভারসিটি তে কনফার্ম করা লাগছে। পরে কি আমার NSTUতে সাব্জেক্ট আসার কোন সুযোগ আছে নাকি পুরোপুরি বাদ যাব? যেহেতু আমার NSTU কখনো সাব্জেক্ট আসে নাই তাই কনফার্ম ও করতে পারি নাই।', NULL, NULL, 1, '2022-12-04 23:02:35', '2022-12-12 12:56:07'),
