(6020, 194693, 'আসসালামুআলাইকুম,আমার একটা বিষয়ে প্রশ্ন ছিল।\r\n৩য় ধাপের ভর্তি কার্যক্রমে প্রথম বার কুমিল্লা বিশ্ববিদ্যালয়ে আমি বিষয়ের জন্য মনোনীত হয়েছি।আমি সেখানে প্রাথমিক ভর্তি কার্যক্রম সম্পন্ন করেছি।এবার ৪র্থ মেধাক্রমে আমি নোবিপ্রবি তে বিষয়ে মনোনীত হয়েছি।এখন আমি যদি ৪র্থ ভর্তি প্রক্রিয়ায় নোবিপ্রবি তে মাইগ্রেশান না করে,অপেক্ষা করি অপেক্ষাকৃত ভালো বিষয় পাওয়ার জন্য, তাহলে কি আমি পরবর্তী মেধাক্রমে নোবিপ্রবি তে আমাকে বিষয়ের জন্য মনোনীত করা হবে?আমাকে দয়া করে জানিয়ে সহায়তা করবেন।', NULL, NULL, 1, '2022-12-06 08:57:53', '2022-12-12 18:26:00'),
