(6022, 146741, 'আসসালামু আলাইকুম। \r\nআমার জিএসটি এপ্লিকেশন আইডিঃ3534783\r\nআমার জিএসটি রোলঃ146741\r\nআমার নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ে টুরিজম এন্ড হসপিটালিটি ম্যানেজমেন্ট সাবজেক্টে প্রাথমিক ভর্তি সম্পূর্ণ করেছি।আমি ইউনিভার্সিটি মাইগ্রেশন অফ করি নি।কিন্তু আমার প্রোফাইলে দেখাচ্ছে আমি ইউনিভার্সিটি মাইগ্রেশন অফ করেছি।\r\nএই মেরিটে nstu ছাড়া কোথাও আমার মেরিট আসে নি।আমার সমস্যার কারন এবং সমাধান দেওয়ার জন্য অনুরোধ করছি।', NULL, NULL, 1, '2022-12-06 19:44:52', '2022-12-12 18:24:20'),
(6023, 222958, 'আপনারা মেরিট লিস্টের পিডিএফ ফাইল দেননা কেন?\r\nপিডিএফ থাকলে আমাদের এনালাইসিস করতে সুবিধা হয়\r\nআমার মনে হয় আপনারা আমাদের অধিকার থেকে আমাদের বঞ্চিত করছেন\r\nএকে তো একটা ভার্সিটি সিলেক্ট করলে বাকি গুলো অটো ক্যান্সেল হয়ে যাবে\r\nএখন যদি বুঝতে না পারি NSTU তে পছন্দের বিষয় পাবো কিনা,কিভাবে অনিশ্চয়তার উপর ভর্তি হবো\r\nদয়া করে মেরিট+এলোটেড সাবজেক্টের পিডিএফ গুলো প্রোভাইড করবেন', NULL, NULL, 1, '2022-12-07 12:07:31', '2022-12-12 13:09:22'),
