(6049, NULL, '•	আবেদনকারী প্রথমবার এক বা একাধিক বিশ্ববিদ্যালয়ে ভর্তির জন্য নির্বাচিত হলে তাকে অবশ্যই যে কোন একটি বিশ্ববিদ্যালয়ে প্রাথমিক ভর্তি সম্পন্ন করতে হবে।\r\n•	প্রাথমিক ভর্তি প্রক্রিয়া সম্পন্ন না করলে পরবর্তীতে GST গুচ্ছভূক্ত কোনো বিশ্ববিদ্যালয়ে ভর্তির জন্য বিবেচিত হবে না। \r\n•	একাধিক বিশ্ববিদ্যালয়ে ভর্তির জন্য বিবেচিত হলে পছন্দমত যেকোনো একটি বিশ্ববিদ্যালয়ে ভর্তির প্রাথমিক প্রক্রিয়া সম্পন্ন করতে হবে। অন্য বিশ্ববিদ্যালয় গুলিতে আর কখনও ভর্তির জন্য বিবেচিত হবে না।', 'Md. Iftekharul Alam Efat', 201351, 0, '2022-12-12 12:55:44', '2022-12-12 12:55:44'),
