(6131, 516591, 'আমি প্রথম মেরিটে জাতীয় কবি নজরুল ইসলাম বিশ্ববিদ্যালয় ভর্তি হই।তৃতীয় মেরিটে আমি বরিশাল বিশ্ববিদ্যালয় মাইগ্রেশন করি। চতুর্থ মেরিটে আমি নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় সাবজেক্ট পাই। কিন্তু আমি নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় ভর্তি হইনি। পঞ্চম মেরিটে যখন নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় মেরি দিল তখন আমি দেখতে পেলাম শিক্ষার্থী কর্তৃক ভর্তি বাতিল লেখা এটার কারণটা কি আমি একটু জানতে চাই।', NULL, NULL, 1, '2022-12-13 21:05:31', '2022-12-14 13:51:39'),
(6132, 195780, 'আসসালামু আলাইকুম। আমার নোবিপ্রবিতে ৫ম মেরিটে টুরিজম এন্ড হসপিটালিটি ম্যানেজমেন্ট সাবজেক্ট এসেছিল।ওয়েবসাইটেও সেটি শো এবং মাইগ্রেশান চালুর তথ্য দেয়া ছিল।পিডিএফ ফাইলেও সেটির তথ্য পেয়েছি। কিন্তু কিছুক্ষণ পরে ওয়েবসাইট থেকে সরিয়ে নেয়া হয়েছে। সাথে ওয়েবসাইটে যুক্ত করা পিডিএফ থেকেও আমার মেরিটে সাবজেক্ট সরিয়ে ফেলা হয়েছে। এখন আমার কি আসলে সাবজেক্টটা কি এসেছিল? জিএসটিতে তো ভর্তি কনফার্ম না করলে পুরো জিএসটি থেকেই বাদ পড়া লাগে।আমার মেরিট ২৩২৩। আমি এ এবং সি ইউনিটের সাবজেক্ট চয়েস দিয়েছিলাম।', NULL, NULL, 1, '2022-12-13 23:16:40', '2022-12-14 13:46:31'),
