(6134, 141856, 'আমার নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ে ৫ম মেরিটে ফিসারিজ ও মেরিন সাইন্স সাবজেক্ট আসছে।১৪ তারিখ মানে আজকে থেকে ভতি কাযক্রম শুরু হওয়ার কথা। কিন্তু আমার gst ওয়েবসাইট এ কোনো বিশ্ববিদ্যালয়ে সাবজেক্ট আসে নাই দেখাচ্ছে।তাই আমি পেমেন্ট ও পেপার শো করাতে পারছি না।।একটু সমস্যা তা দ্রুত সমাধান করলে ভালো হবে।।', NULL, NULL, 1, '2022-12-14 11:51:43', '2022-12-14 14:00:41'),
