(6163, 104309, 'আসসালামুআলাইকুম স্যার, আমি ১ম মেরিটে হাজী মোহাম্মদ দানেশ বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয়ে রসায়নে ভর্তি আছি। এবং ২য় মেরিটে বরিশাল বিশ্ববিদ্যালয়ে গণিত বিষয়ে ভর্তি আছি। নোয়াখালী বিজ্ঞান ও প্রযুক্তি বিশ্ববিদ্যালয় কোটায় ভর্তি নির্দেশনা অনুযায়ী ১৯/১২/২০২২ তারিখ সরাসরি ভর্তির কথা বলা হয়েছে যেখানে এসএসসি ও এইসএসসির মূল কাগজপত্র চাওয়া হয়েছে। মূল কাগজপত্র তো জমা দেয়া স্যার। এক্ষেত্রে কী করতে পারি ?', NULL, NULL, 0, '2022-12-15 07:18:34', '2022-12-15 07:18:34'),
(6164, 104309, 'আসসালামুআলাইকুম স্যার, মুক্তিযোদ্ধা কোটায় আমার পজিশন 53, আমি কী সাবজেক্টে ভর্তি হব এটা কিভাবে জানতে পারব স্যার ?  নাকি যেউ তার পছন্দ অনুযায়ী যেকোন সাবজেক্টে ভর্তি হতে পারবে স্যার ?', NULL, NULL, 0, '2022-12-15 09:41:10', '2022-12-15 09:41:10'),
(6165, 175885, 'মুক্তিযোদ্ধা কোটায় যারা আবেদন করছে তারা সবাই নাকি শুধু যাদের মুক্তিযোদ্ধা কোটার মেরিটে নাম আসছে তারা শুধু ।', NULL, NULL, 0, '2022-12-15 11:07:16', '2022-12-15 11:07:16'),
(6166, 203769, '\"শিক্ষার্থী কর্তৃক ভর্তি বাতিল\"...এই লিখাটা আসার কারণ কী?\r\nআমি তো কোনো কিছুই বন্ধ করি নি!', NULL, NULL, 0, '2022-12-15 11:33:05', '2022-12-15 11:33:05'),
(6167, 177564, '১. কোটায় আবেদনকারীদের ভর্তি ফি জমাদানের বিষয়টি বুঝতে পারছি না। কত তারিখের মধ্যে জমা দিতে হবে? সাহায্য করুন।\r\n২. ইউনিট ভিত্তিক চয়েস ফরম বলতে কি acknowledgment slip সাথে নিয়ে আসতে হবে?', NULL, NULL, 0, '2022-12-15 11:44:15', '2022-12-15 11:44:15'),
(6168, 211069, 'সম্মানিত স্যার,\r\nদয়া করে বলতে পারেন, হরিজন ও দলিত সম্পদায়ের কোটার মেরিট পজিশন ২৮ A ইউনিট আমার জন্য ও কি ১৯ ডিসেম্বর ভর্তির জন্য ইউনিভার্সিটি তে আসার নির্দেশনা রয়েছে?', NULL, NULL, 0, '2022-12-15 12:04:50', '2022-12-15 12:04:50'),
