(6170, 525219, 'আমি মুক্তিযোদ্ধা কোটা সি ইউনিটে ১২৫ তম হয়েছি।কিন্তু \r\nকোটার শিক্ষার্থীদের ডাকা হয়েছে। আমাকে কি আপনাদের  ওখানে উপস্থিত হতে হবে।', NULL, NULL, 0, '2022-12-15 12:52:56', '2022-12-15 12:52:56'),
(6171, 540272, 'আমি admission এর system না বোঝার কারণে প্রাথমিক ভর্তি ফি পরিশোধ করতে সমর্থ হয়নি।migration system বোঝতে আমার ভুল হয়েছে।যদি সম্ভব হলে আমার roll সামনের merit list দিলে কৃতজ্ঞতা থাকব।', NULL, NULL, 0, '2022-12-15 14:41:09', '2022-12-15 14:41:09');
